document.addEventListener("DOMContentLoaded",function(){Array.prototype.forEach.call(document.getElementsByClassName("pseudo-link"),function(t){t.dataset.href=btoa(t.dataset.href),t.setAttribute("href","javascript:void(0);"),t.onclick=function(){t.classList.contains("blank")?window.open(atob(this.dataset.href),"_blank"):window.location.href=atob(this.dataset.href)}})});